import React from 'react'
import './index.css'

const Cart=()=>{
    return(
        <section className='space-cart slide-left'>
            <h3>Hi 訪客您好<br/>以下是您的購物袋內容 : </h3>
            <div className='space-cart-ticket'></div>
            <div className='space-cart-departure'></div>
            <div className='space-cart-passenger'></div>
        </section>
    )
}
export default Cart
